import React from 'react'
import style from './index.module.scss'
import moment from 'moment'
import { DatePicker, TimePicker, Space, Select } from 'antd';

const { Option } = Select;
export default function Index() {
  const [dep, setDep] = React.useState('')
  const departure = (e) => {
    // console.log(e.target.value);
    setDep(e.target.value)
  }
  const datepick = (date, dateString) => {
    console.log(date, dateString);
  }
  const airport = (value) => {
    console.log(value);
  }
  const phone = (e) => {
    console.log(e.target.value);
  }
  const time = (time, timeString) => {
    console.log(time, timeString);
  }
  return (
    <div className={style.form_content}>
      <div>
        <span>Departure: </span>
        <input onChange={departure} type="text" className={style.input_text} />
      </div>
      <div>
        <span>Airport: </span>
        <Select placeholder="Select Airport" style={{ width: 148 }} onChange={airport}>
          <Option value="BNE Domestic Airport">BNE Domestic Airport</Option>
          <Option value="BNE International Airport">BNE International Airport</Option>
        </Select>
      </div>
      <div>
        <span>Date: </span>
        <Space direction="vertical">
          <DatePicker onChange={datepick} />
        </Space>
      </div>
      <div>
        <span>Phone Num: </span>
        <input onChange={phone} type="text" className={style.input_text} />
      </div>
      <div>
        <span>Time: </span>
        <TimePicker onChange={time} defaultOpenValue={moment('00:00', 'HH:mm')} />
      </div>
    </div>

  )
}
